const Render = () => {

    const [data, setData] = useState();

    useEffect(() => {
        db.collection("posts")
        .get()
        .then(querySnapshot => {
            const data = querySnapshot.docs.map(doc => doc.data());
            setData(data);
        });
    }, []);

    console.log(data)

    const list = data.map((datas) =>
        <li key={datas.uid}>{datas.author}</li>
    );

